import * as React from "react";
import Grid from "@mui/material/Grid";
import Box from "@mui/material/Box";
import "./Education.css";

function Education() {
  return (
    <div id="education">
      <h3 className="header">Education</h3>
      <div className="gridContainer">
        <Grid
          alignItems="center"
          justifyContent={"center"}
          container
          spacing={4}
        >
          <Grid item xs>
            <Box
              sx={{
                width: 400,
                height: 400,
                backgroundColor: "#ff5757",
                borderRadius: 8,
                "&:hover": {
                  backgroundColor: "black",
                  opacity: [0.9, 0.8, 0.7],
                },
              }}
            />
          </Grid>
          <Grid item xs>
            <Box
              sx={{
                width: 400,
                height: 400,
                borderRadius: 8,
                backgroundColor: "#ff5757",
                "&:hover": {
                  backgroundColor: "black",
                  opacity: [0.9, 0.8, 0.7],
                },
              }}
            />
          </Grid>
          <Grid item xs>
            <Box
              sx={{
                width: 400,
                height: 400,
                borderRadius: 8,
                backgroundColor: "#ff5757",
                "&:hover": {
                  backgroundColor: "white",
                },
              }}
            />
          </Grid>
        </Grid>
      </div>
    </div>
  );
}
export default Education;
